import React,{useState,useEffect,selectChange,cardSelector,Component} from 'react';
import {Button} from '@material-ui/core';
import { Link } from 'react-router-dom';
import Navbar1 from './Navbar1';
import Menu1 from './Menu1';
import Device from './Device';
import './style.css';
import { Menu, SignalWifi1BarLockSharp } from '@material-ui/icons';

import { makeStyles } from '@material-ui/core/styles';
import Paper from '@material-ui/core/Paper';
import Grid from '@material-ui/core/Grid';

const useStyles = makeStyles((theme) => ({
  root: {
    flexGrow: 1,
  },
  paper: {
    padding: theme.spacing(2),
    textAlign: 'center',
    color: theme.palette.text.secondary,
    spacing:0,
  },
}));

const Devices = () => {
  const classes = useStyles();

  function FormRow() {
    return (
      <React.Fragment>
        <Grid item xs={4}>
          <Paper className={classes.paper}>item</Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>item</Paper>
        </Grid>
        <Grid item xs={4}>
          <Paper className={classes.paper}>item</Paper>
        </Grid>
      </React.Fragment>
    );
  }

  return (
    
    <div>
        <Navbar1/>
        <div className="container4">
        <Menu1/>
        <Device/>
        <div className="devicestatus">
            <a className="h31">Device Status</a>
            <a className="p3">&nbsp;&nbsp;&nbsp;&nbsp;Last updated 10 secs ago </a>
            <div className="container6">
            <div className={classes.root}>
      <Grid container spacing={1}>
        <Grid container item xs={12}>
          <FormRow />
        </Grid>
        <Grid container item xs={12}>
          <FormRow />
        </Grid>
      </Grid>
    </div>
            </div>
        </div>
        </div>
    </div>
  );
};

export default Devices;
